import React from "react";
import Navbar from "./components/navbar/Navbar";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
	return (
		<div>
 <BrowserRouter>
				<Routes>
					<Route path="/" element={<Navbar/>} />				
				</Routes>
			</BrowserRouter>
		</div>	
	);
}
export default App;
